import { useEffect, useState } from "react";
import { Route, useHistory, Switch } from "react-router";
import {
  AppBar,
  CssBaseline,
  Drawer,
  Grid,
  IconButton,
  Toolbar,
  Typography,
} from "@material-ui/core";
import axios from "axios";

// components
import Sidebar from "../components/Sidebar/Sidebar";
import MainContent from "../components/Content/MainContent";
// styles
import useStyles from "./DashbaordStyles";
import Navbar from "../components/Navbar/Navbar";
import Client from "../components/Content/Client/Client";
import Branch from "../components/Content/Branch/Branch";
import ContactPerson from "../components/Content/ContactPerson/ContactPerson";
import Contract from "../components/Content/Contract/Contract";
import Count from "../components/Content/Count";
import Profile from "../components/Content/Profile/Profile";
import Test from "./Test";

const Dashboard = () => {
  const classes = useStyles();
  const history = useHistory();
  const theme = useTheme();
  const [open, setOpen] = React.useState(false);

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  useEffect(() => {
    axios
      .get("/auth/refreshtoken")
      .then((response) => {})
      .catch((err) => history.push("/"));
  }, [history]);

  return (
    <div className={classes.root}>
      <CssBaseline />

      <AppBar
        position="fixed"
        className={clsx(classes.appBar, {
          [classes.appBarShift]: open,
        })}
      >
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            className={clsx(classes.menuButton, open && classes.hide)}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap>
            Persistent drawer
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        className={classes.drawer}
        variant="persistent"
        anchor="left"
        open={open}
        classes={{
          paper: classes.drawerPaper,
        }}
      >
        <div className={classes.drawerHeader}>
          <IconButton onClick={handleDrawerClose}>
            {theme.direction === "ltr" ? (
              <ChevronLeftIcon />
            ) : (
              <ChevronRightIcon />
            )}
          </IconButton>
        </div>
        <Divider />
        <List>
          {["Inbox", "Starred", "Send email", "Drafts"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {["All mail", "Trash", "Spam"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </Drawer>

      <Switch>
        <Route path="/client">
          <Client />
        </Route>
        <Route path="/branch">
          <Branch />
        </Route>
        <Route path="/contactPerson">
          <ContactPerson />
        </Route>
        <Route path="/contract">
          <Contract />
        </Route>
        <Route path="/profile">
          <Profile />
        </Route>
        <Route path="/test">
          <Test />
        </Route>
        <Route path="/">
          <Count />
        </Route>
      </Switch>
    </div>
  );
};

export default Dashboard;
